import React from 'react';

const Article = (props) => {
    return (
        <div className='cardContainer' style={{width: 80 + '%'}}>
            {console.log(props)}
            <div style={{display: 'flex'}}>
                <h1>{props.props['author']}</h1>
                <h3>{props.props['date']}</h3>
            </div>
            <h3>{props.props['content']}</h3>
        </div>
    );
};

export default Article;
